import React from 'react';
import './styles.css';
import { Link } from 'react-router-dom';
import data from './data';
import ShoppingList from './ShoppingList'

export class AllShoppingLists extends React.Component {
    render() {
        return(
            <section className="list w-full min-h-full">
            <main className="flex flex-col text-center">
               <div className="h1">BAZAARA</div>
            </main>
                <div id="list">
                    <form>
                    <input>
                    </input>
                    <button type="submit">shopo</button>    
                    </form>    
                </div>
                <div className="wrapper">
      <h1>Animals</h1>
      {data.map(listName => (
        <ShoppingList key={listName.name}/>
      ))}
    </div>
    
            </section>
        );
    }

}

export default ShoppingList;
